using namespace std;
inline char change(int x)
{
	if(x > 9) return 'A' + x - 10;
	return x + '0';
}
string m[10000];
map<string, int> rec;
void init2();
void init1();
bool ok(char ch)
{
	return ('0' <= ch && ch <= '9') || ('A' <= ch && ch <= 'F');
}
bool is_space(char ch)
{
	return ch == ' ' || ch == '\t';
}
string work(string s)
{
	int i=0;
	for(i = s.length()-1; i > 0; i--) if(!is_space(s[i])) break;
	return s.substr(0, i+1);
}
int main()
{
	string s;
	char tmp[2];
	init1(), init2();
	while(true) {
		int res = 0;
		tmp[0] = getchar(), tmp[1] = getchar();
		if(!ok(tmp[0])) break;
		if('A' <= tmp[0] && tmp[0] <= 'F') res = tmp[0] - 'A' + 10;
		else res = tmp[0] - '0';
		if('A' <= tmp[1] && tmp[1] <= 'F') res = res * 16 + tmp[1] - 'A' + 10;
		else res = res * 16+tmp[1] - '0';
		s = work(m[res]);
		res = rec[s];
		printf("%c%c", change(res/16),change(res%16));
	}
		printf("\n");
	return 0;
}


